import logo from "./logo.svg";
import "./App.css";
import { useState } from "react";

function App() {
  let [num, setNum] = useState(0);

  return (
    <div className="App">
      <button
        onClick={(e) => {
          setNum(num - 1);
        }}
      >
        -
      </button>
      <button>0</button>
      <button
        onClick={(e) => {
          setNum(num + 1);
        }}
      >
        +
      </button>
      <samp>{num}</samp>
    </div>
  );
}

export default App;
